import React from 'react';



class Game2 extends React.Component {
    
    render() { 
        return (
            <div className="d-flex">
                    <div className="col-6 colModif2">
                        <button className="modifButton2">
                            <img className="tailleImg2 img-fluid" src={this.props.image} alt="" />
                        </button>
                    </div>
                    <div className="col-6 colModif">
                        <button className="modifButton">
                            <img className="tailleImg1  img-fluid" src={this.props.image} alt="" />
                        </button> 
                    </div>
                </div>
        );
    }
}

export default Game2;
